import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const styles = {
  li: {
    listStyleType: 'none',
    marginLeft: '-1vw',
    fontSize: '1.5rem',
    fontWeight: '600'
  }
};

const List = props => {
  return (
    <ul>
      {props.items.map((item, index) => {
        return (<li style={styles.li}>
          <FontAwesomeIcon key={index} icon="arrow-right" />
          &ensp; {item}
        </li>);
      })}
    </ul>
  );
};

export default List;
